  false,\n\t\"url\": null,\n\t\"notes\": \"From July 17 to 26, 1990, 20 largemouth
  bass (Micropterus salmoides) were collected from four locations at the Crystal River
  National Wildlife Refuge, Citrus County, Florida. The fish were collected for mercury
  analysis of muscle tissue. Three percent of the largemouth bass had mercury levels
  (range=0.20 to 1.17 ppm) which exceeded the Florida limited-consumption concentration
  of 0.5 parts per million (ppm), wet weight. No fish exceeded Florida's no-consumption
  concentration of 1.5 ppm. Evaluation of weight, length and site location of largemouth
  bass did not provide mechanisms by which recreational fishermen could selectively
  avoid individual fish that are high in mercury. All locations that were sampled
  appear to provide environments conducive for accumulation of mercury in largemouth
  bass; however, there were no significant differences in mercury concentrations between
  stations. Because all fish collected contained concentrations of mercury greater
  than 0.1 ppm, some Fish and Wildlife Service trust species may be exposed to risk
  when utilizing the habitat areas that were sampled. Additional geographic and biotic
  environmental contaminant work is recommended.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
